export default function handleCep(event){
    var campo = event.target;
    var valor = campo.value.replace(/\D/g, '');
    valor = valor.padStart(8, '0');
    valor = valor.replace(/(\d{5})(\d{3})/,'$1-$2');
    event.target.value = valor;
}
